import Carousel from 'react-bootstrap/Carousel';
import Img from './Img';
function Slides() {
  return (
    <Carousel data-bs-theme="dark">
   {
Img.map((val)=>{
    return(   <Carousel.Item>
        <img
          className="d-block w-100"
          src={val.src}
          alt="First slide"
        />
        <Carousel.Caption>
          <h5>{val.p}</h5>
          <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
        </Carousel.Caption>
      </Carousel.Item>)
})
   }
     
    </Carousel>
  );
}

export default Slides;
